import React from 'react';
import Carousel from 'react-bootstrap/Carousel'

function Carosello(){
    return(
        <Carousel>
        <Carousel.Item interval={1000}>
            
        </Carousel.Item>
        <Carousel.Item interval={500}>
        
        </Carousel.Item>
        <Carousel.Item>
            
        </Carousel.Item>
        </Carousel>
    );
}
export default Carosello;
